import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import withTimeTracker from './css/withTimeTracker'; // Adjust the path based on your project structure
import './index.css';

const TimeTrackedApp = withTimeTracker(App);

ReactDOM.render(
  <React.StrictMode>
    <TimeTrackedApp />
  </React.StrictMode>,
  document.getElementById('root')
);
